import {TopBar} from "./App";
import Card from 'react-bootstrap/Card';
import Accordion from 'react-bootstrap/Accordion';
import  './voice.css';
import {useEffect, useState} from "react";
import axios from 'axios';


const Voice = () => {
    const [imageBase64, setImageBase64] = useState('');
    const [message, setMessage] = useState("");

    useEffect(() => {
    axios.get('http://127.0.0.1:5000/voice')
      .then(response => {
        console.log(response.data.image);
        setImageBase64(response.data.image);
      })
      .catch(error => console.error('Error:', error));
  }, []);
  return (
      <>
          <TopBar />
          <div style={{ position: 'relative' }}>
              <Card id={"video"}>
                  <Card.Img src="./logo.svg" />
              </Card>
              <Accordion defaultActiveKey={['0']} alwaysOpen>
                  <Accordion.Item eventKey="0">
                      <Accordion.Header>Summary</Accordion.Header>
                      <Accordion.Body>
                          1
                      </Accordion.Body>
                  </Accordion.Item>
                  <Accordion.Item eventKey="1">
                      <Accordion.Header>Pitch</Accordion.Header>
                      <Accordion.Body>
                         <Card.Body className="withSeparator">This is some text within a card body.</Card.Body>
                      {imageBase64 && <img src={`data:pitch_image/png;base64,${imageBase64}`} alt="Generated Plot" />}
                          <p>
                              {"data:message"}
                          </p>
                      </Accordion.Body>
                  </Accordion.Item>
                  <Accordion.Item eventKey="2">
                      <Accordion.Header>Volume</Accordion.Header>
                      <Accordion.Body>
                         <Card.Body className="withSeparator">This is some text within a card body.</Card.Body>
                      3
                      </Accordion.Body>
                  </Accordion.Item>
              </Accordion>
          </div>
      </>
  );
}
export default Voice;
